import React from 'react'
import NavbarRadnik from '../NavbarRadnik'
import Profile from '../Profile'
import './RadnikMojProfil.css'
import jane from '../../images/jane-doe.jpg';

export default class RadnikMojProfil extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      photo: jane,
      profileFields: {
        firstName: 'Jane',
        jobTitle: 'Web Developer',
        birthday: null,
        bio: null
      }
    }
  }

  render () {
    return (
      <div className="profile-page">
        <NavbarRadnik/>
        <Profile ime={this.state.firstName}  photo={this.state.photo} />
      </div>
    )
  }
}
